class Solution {
    func minChanges(_ s: String) -> Int {
        let chars = Array(s)
        let n = chars.count
        var changes0 = 0, changes1 = 0

        for i in 0..<n {
            if i % 2 == 0 {
                if chars[i] == "1" {
                    changes0 += 1
                } else {
                    changes1 += 1
                }
            } else {
                if chars[i] == "0" {
                    changes0 += 1
                } else {
                    changes1 += 1
                }
            }
        }

        return min(changes0, changes1)
    }
}
